    def assign(self, id, ch, t):
        """
        :param id: 角色id
        :param ch: 角色职业 type(Character).__name__
        :param t: 倒计时 从100平稳给到0
        :return:
        """
        if id == 0:
            self.label_id.setText("")
        else:
            self.label_id.setText(str(id))
        dict_card = {'Werewolf': "border-image: url(:/login/ui/werewolf.png);",
                     'Villager': "border-image: url(:/login/ui/villager.png);",
                     'Seer': "border-image: url(:/login/ui/seer.png);",
                     'Witch': "border-image: url(:/login/ui/witch.png);",
                     'Hunter': "border-image: url(:/login/ui/hunter.png);"}
        self.label_card.setVisible(True)
        self.label_card.setStyleSheet(dict_card[ch])
        self.progressBar_time_assign.setValue(t)  # 倒计时100-0

    def clean(self):
        """
        清屏, assign()后面用
        :return:
        """
        self.label_id.setText("")
        self.label_card.setVisible(False)
        self.progressBar_time_assign.setValue(100)

    def jump_werewolf(self):
        """跳转狼人界面"""
        self.stackedWidget.setCurrentIndex(5)

    def update_werewolf(self, id, pro, t, confirm):
        """
        显示选择杀人界面
        :param id: 被杀id
        :param pro: 确定进度条
        :param t: 倒计时 100->0
        :param confirm: 玩家确认标志，True为只更新时间，False为更新所有
        :return:
        """

        self.label_killed.setVisible(True)
        if confirm is False:
            if id == 0:
                self.label_id_killed.setText("")
            else:
                self.label_id_killed.setText(str(id))
            self.progressBar_id_killed.setValue(pro)  # 手势确认0-100
            self.progressBar_time_werewolf.setValue(t)  # 倒计时100-0
        else:
        # self.label_img_killed.setStyleSheet("border-image: url(:/login/ui/werewolf.png);")
            self.progressBar_time_werewolf.setValue(t)  # 倒计时100-0

    def jump_seer(self):
        self.stackedWidget.setCurrentIndex(6)

    def update_seer(self, id, status, pro, t, confirm):
        """
        :param id:
        :param status: 验人状态，0为坏人，1是好人，2为不确定
        :param pro:
        :param t:
        :return:
        """
        if confirm is False:
            if id == 0:
                self.label_id_seer.setText(" ")
            else:
                self.label_id_seer.setText(str(id))

            self.progressBar_id_seer.setValue(pro)
            self.progressBar_time_seer.setValue(t)
        else:
            self.progressBar_time_seer.setValue(t)

        if status == 0:
            self.label_good.setVisible(False)
            self.label_bad.setVisible(True)
        elif status == 1:
            self.label_good.setVisible(True)
            self.label_bad.setVisible(False)
        elif status == 2:
            self.label_good.setVisible(False)
            self.label_bad.setVisible(False)

