    def status(self, dict):
        self.label_id = {1: self.label_id_1,
                         2: self.label_id_2,
                         3: self.label_id_3,
                         4: self.label_id_4,
                         5: self.label_id_5,
                         6: self.label_id_6,
                         7: self.label_id_7,
                         8: self.label_id_8,
                         9: self.label_id_9,
                         10: self.label_id_10}

        self.label_s = {1: self.label_s1,
                        2: self.label_s2,
                        3: self.label_s3,
                        4: self.label_s4,
                        5: self.label_s5,
                        6: self.label_s6,
                        7: self.label_s7,
                        8: self.label_s8,
                        9: self.label_s9,
                        10: self.label_s10}

        for i in range(1, len(dict) + 1):
            self.label_id[i].setVisible(True)
            self.gridLayout.addWidget(self.label_id[i], (i - 1) // 5 * 2, (i - 1) % 5, 1, 1)
            self.label_s[i].setVisible(True)
            self.gridLayout.addWidget(self.label_s[i], (i - 1) // 5 * 2 + 1, (i - 1) % 5, 1, 1)
            if dict[i] == "killed":
                self.label_s[i].setStyleSheet("image: url(:/login/ui/death.png);")
            elif dict[i] == "poisoned":
                self.label_s[i].setStyleSheet("image: url(:/login/ui/poison_l.png);")
            elif dict[i] == "shot":
                self.label_s[i].setStyleSheet("image: url(:/login/ui/mul.png);")
            elif dict[i] == "voted":
                self.label_s[i].setStyleSheet("image: url(:/login/ui/exile.png);")
            else:
                self.label_s[i].setVisible(False)


